import React from 'react';
import './css/UI.css';
import List from './List.jsx';

class Content extends React.Component{
    render(){
      const activities={
        "title":"Activity",
        "desc":"Morning activity"
      }

      return (
        <div>
        <List title={activities[title]} desc={activities[desc]}/>
        </div>
      )
    }
}
export default Content;
